import React, { Component } from 'react';
import anime from 'animejs';
import '../css/bst.css';

anime({
    targets: 'div',
    keyframes: [
        {translateX: 0},
        {translateY: 500},
        {translateX: 800, translateY: 0},
        {translateY: 500},
        {translateX: 0, translateY: 0},
    ],
    duration: 400,
});

class AnimeTest extends Component {
    constructor (props) {
        super(props);
    }

    shouldComponentUpdate(){
        return false;
    }



    render(){ 
        return(
        <div class="bstnode">Test one.</div>
        );
    }
}

export default AnimeTest;
